using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using AlgorithmHackerrank.Searching;
using AlgorithmHackerrank.Strings;
using FluentAssertions;
using Xunit;

namespace AlgorithmHackerrank.Tests.Strings
{
    public class BearAndSteadyGeneTests
    {
        [Theory]
        //[InlineData(@"8  
        //GAAATAAA", @"5")]
        [InlineData(@"40
        TGATGCCGTCCCCTCAACTTGAGTGCTCCTAATGCGTTGC", "5")]
        [InlineData(@"1500
        ", "0")]
        [InlineData(@"2000
        ", "1393")]
        [InlineData(@"150000
        ", "206")]

        public void MainFlow(string inputString, string expectedString)
        {
            var algor = new BearAndSteadyGene();
            var input = new StringReader(inputString);

            int n = Convert.ToInt32(input.ReadLine());

            string gene = input.ReadLine().Trim();

            int result = algor.FindSmallestSubsequenceToReplace(gene);

            expectedString.Should().Be(result.ToString());

        }
    }
}
